import React from "react";

const useRedirect = () => {
    function NotFound() {
        const navigate = useNavigate();

        useEffect(() => {
            navigate('/error');
        }, [navigate]);
    }
    return (
        <div>
            Redirecting...
        </div>
    )
};

export default useRedirect
